import React, {Component} from 'react';

import FriendRequest from './FriendRequest';
import FriendSuggest from './FriendSuggest';

import './Box.css';



class Friend extends Component {

    render() {
        return (
            <div>
                <div id='box' >
                    <FriendRequest />
                </div>
                <div id='box' >
                    <FriendSuggest />
                </div>
                <div id='box' >
                    친구 검색
                </div>
            </div>
        );
    }
}

export default Friend;
